import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  state = {
    sometext: ''
  };
  onChangeTextHandler = event => {
    this.setState({
      sometext: event.target.value
    });
  };
  render() {
    return (
      <div className="App">
        {/* comment */}
        <h1>Databinding 1</h1>
        <div>
          some text:
          <input type="text" onChange={this.onChangeTextHandler} />
        </div>
        <h3>{this.state.sometext}</h3>
      </div>
    );
  }
}

export default App;
